import './App.css';

function App() {
  return (
    <div className="container mt-5">
      <h1 className="text-center text-primary">Blog Uygulaması</h1>
      <button className="btn btn-primary mt-3">Gönderi Oluştur</button>
    </div>
  );
}

export default App;
